# kubectl apply -f https://github.com/bitnami-labs/sealed-secrets/releases/download/v0.27.0/controller.yaml
# Generate it with:
# kubeseal --controller-name=sealed-secrets-controller --controller-namespace=kube-system --format yaml < secret.yaml > pos-secret-sealed.yaml
---
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  creationTimestamp: null
  name: pos-secrets
  namespace: pos
spec:
  encryptedData:
    POS_DB_URL: 
    RABBIT_SVC_URL: 
    ROOT_TOKEN: 
    RUST_LOG: 
    SERVICE_TOKEN_DURATION_SEC: 
    SERVICE_TOKEN_KEY: 
    USER_DB_URL: 
    ZUPPLER_DB_URL: 
    ZUPPLER_DOMAIN: 
  template:
    metadata:
      creationTimestamp: null
      name: pos-secrets
      namespace: pos
    type: Opaque
